import React from "react";
// import web from "../src/images/it_building.jpg";
// import { NavLink } from "react-router-dom";
import Typical from 'react-typical';
import PaintCard from "./PaintCard";
import Expert from "./Expert";


const Home = () => {

return(
    <>
      <section id= "header" className="d-flex align-items-center" >
        <div className="container-fluid nav_bg center-div" >
            <div className="row" >
                 <div className="col-12 mx-auto" >
                     <div className="row">
                     <div className="text-white d-flex justify-content-center flex-column text-center animated">
                         <h1> Painting </h1>
                          <h2 className="my-3 text-capitalize"> Join us<span>
                              <Typical
                                steps={['order now',5000,'',3000]}
                                loop={Infinity}
                                wrapper="h2"
                            />
                            </span>
                         </h2>
                     </div>
                 </div>
             </div>
             </div>
       </div>
       
      </section>
      <PaintCard/>
      <Expert/>
      
    </>
);
};
export default Home;
